import React from 'react';


export default function fiterRating(props) {
    const fiterRating = [];
    for (i = 1; i <= 5; i++) {
        fiterRating.push(
            <label className="form-check">
                <input className="form-check-input"
                    type="checkbox"
                    name={i}
                    onChange={props.filterRate}
                />
                <span className="form-check-label">
                    {i} sao
</span>
            </label> 
        )
    }
    return (
        {fiterRating}
    )
}
